import React from 'react';
import PropTypes from 'prop-types';

// Styling
import { Box, Flex, Row } from '../../styles';

const Quote = ({ item }) => (
  <Row>
    <Flex justifyContent="center">
      <Box width={8 / 12}>test</Box>
    </Flex>
  </Row>
);

Quote.propTypes = {
  item: PropTypes.object.isRequired,
};

export default Quote;
